import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function Footer() {
    return (
        
        <footer className="bg-dark text-white text-center ">
            <Container>
                <Row>
                    <Col>
                        <p>&copy; 2024 Productos buenos. Todos los derechos reservados.</p>

                    </Col>
                </Row>
            </Container>
        </footer>
    );
}

export default Footer;
